import React from 'react';
import {Form, Input, Message, Button} from 'semantic-ui-react';

export const ContributeForm = () => {
    return(
        <Form>
            <Form.Field>
                <label>Amount to Contribute</label>
                <Input 
                    label="ether"
                    labelPosition="right"
                />
            </Form.Field>
            <Button primary>
                Contribute!
            </Button>
        </Form>
    )
};
